  换过 = true
  while 换过 {
    换过 = false
    for i in range(0, len(数列) - 1) {
      前项 = 数列[i]
      后项 = 数列[i + 1]
      if (前项 > 后项) {
        数列[i], 数列[i + 1] = tuple(后项, 前项)
        换过 = true
      }
    }
  }
}
